  false,\n\t\"url\": null,\n\t\"notes\": \"Pelagic eggs collected using the CUFES
  during cruises conducted by the SWFSC Fisheries Resources Division from 1996 to
  present. Data are typically collected every 30 min while the ship is underway. Eggs
  are identified as Pacific sardine, northern anchovy, jack mackerel, hake, squid,
  or other fish eggs. Some additional species identifications have been noted in the
  comments.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
